namespace RonSijm.FluidHumidifier.Factories.DataBrew;

public class JobFactory(string resourceName = null, Action<Humidifier.DataBrew.Job> factoryAction = null) : ResourceFactory<Humidifier.DataBrew.Job>(resourceName)
{

    internal List<InnerJobDatabaseOutputFactory> DatabaseOutputsFactories { get; set; } = [];

    internal List<InnerJobOutputFactory> OutputsFactories { get; set; } = [];

    internal List<InnerJobValidationConfigurationFactory> ValidationConfigurationsFactories { get; set; } = [];

    internal List<InnerJobDataCatalogOutputFactory> DataCatalogOutputsFactories { get; set; } = [];

    internal InnerJobRecipeFactory RecipeFactory { get; set; }

    internal InnerJobOutputLocationFactory OutputLocationFactory { get; set; }

    internal InnerJobProfileConfigurationFactory ProfileConfigurationFactory { get; set; }

    internal InnerJobJobSampleFactory JobSampleFactory { get; set; }

    protected override Humidifier.DataBrew.Job Create()
    {
        var jobResult = CreateJob();
        factoryAction?.Invoke(jobResult);

        return jobResult;
    }

    private Humidifier.DataBrew.Job CreateJob()
    {
        var jobResult = new Humidifier.DataBrew.Job
        {
            GivenName = InputResourceName,
        };

        return jobResult;
    }
    public override void CreateChildren(Humidifier.DataBrew.Job result)
    {
        base.CreateChildren(result);

        result.DatabaseOutputs = DatabaseOutputsFactories.Any() ? DatabaseOutputsFactories.Select(x => x.Build()).ToList() : null;
        result.Outputs = OutputsFactories.Any() ? OutputsFactories.Select(x => x.Build()).ToList() : null;
        result.ValidationConfigurations = ValidationConfigurationsFactories.Any() ? ValidationConfigurationsFactories.Select(x => x.Build()).ToList() : null;
        result.DataCatalogOutputs = DataCatalogOutputsFactories.Any() ? DataCatalogOutputsFactories.Select(x => x.Build()).ToList() : null;
        result.Recipe ??= RecipeFactory?.Build();
        result.OutputLocation ??= OutputLocationFactory?.Build();
        result.ProfileConfiguration ??= ProfileConfigurationFactory?.Build();
        result.JobSample ??= JobSampleFactory?.Build();
    }

} // End Of Class

